const App = () => {
  const movie1 = {
    Title: "The Lion King",
    Year: "2019",
    Runtime: "118 min",
    Poster:
      "https://m.media-amazon.com/images/M/MV5BMjIwMjE1Nzc4NV5BMl5BanBnXkFtZTgwNDg4OTA1NzM@._V1_SX300.jpg",
  };

  return (
    <div>
      <div className="box">{movie1.Poster}</div>
    </div>
  );
};
export default App;
